import Hero from "../components/Hero";
import Navbar from "../components/Navbar";
import AboutImg from "../assests/img5.jpg";
import Footer from "../components/Footer";

function Contact(){
    return(
        <>
        <Navbar />
        <Hero 
        cName="hero-mid"
        heroImg={AboutImg}
        title="Contact"
        btnClass="hide"
        />
        <Footer />
        </>
    )
}

export default Contact;
